1. 전체 시나리오 상세 묘사  
   - 장면 시작(T₁): 한 남성이 책장이 가득 찬 서재 앞에 서 있다.  
   - 중간 전환(T₂): 남성이 오른손을 들어 설명하듯 제스처를 취하며 입을 움직인다.  
   - 텍스트 등장(T₃): 화면 하단에 “And then Denver second”라는 자막이 흰 글씨로 페이드 인.  
   - 장면 종료(T₄): 자막이 고정된 상태에서 남성의 제스처가 멈추고, 잠시 정지 후 반복 재생.  

2. 등장 객체 목록  
   1) explicit 오브젝트  
      - person: 남성 1명  
      - bookshelf: 배경 전체를 채운 책장  
      - books & decor: 책들, 소품(인형·글로브 등)  
      - banner: 화면 좌측 상단 ‘KENNEDY 2024’ 로고  
      - text_overlay: “And then Denver second” 자막  
      - system: 플레이어 UI (프레임 전환)  
   2) implicit 오브젝트: 없음 (작은 객체들이 의도적으로 모여 비유적 형상을 이루진 않음)  

3. 프레임별 상호작용 요약  
   - T₁→T₂: person이 제스처를 시작하며 몸통 및 팔 위치가 변형(motion)  
   - T₂→T₃: system이 text_overlay를 화면에 오버레이(appearance)  
   - 전 구간: person과 bookshelf·banner는 정적 배경 관계(visual framing)  

4. 상호작용 상세 (JSON 형식)  
[  
  {  
    "관여하는 객체": ["person"],  
    "상호작용 종류": "motion",  
    "상호작용의 파라미터": ["trajectory: 상체 오른쪽·위쪽으로 회전", "speed: 중간"]  
  },  
  {  
    "관여하는 객체": ["system", "text_overlay"],  
    "상호작용 종류": "appearance",  
    "상호작용의 파라미터": ["text: 'And then Denver second'", "position: bottom", "fade_in: 0.3s"]  
  },  
  {  
    "관여하는 객체": ["person", "bookshelf"],  
    "상호작용 종류": "visual framing",  
    "상호작용의 파라미터": ["relative_position: 전경", "scale: medium"]  
  }  
]  

5. 유사 상황 비유  
한 후보자가 서재 배경에서 정책을 설명하는 정치 캠페인 영상처럼 보입니다. 책장은 신뢰감을, ‘KENNEDY 2024’ 로고는 캠페인 홍보판을 연상시킵니다.  

6. 객체 위치 2D 그리드 (가로30×세로18)  
– 좌표계: (x:0~29, y:0~17)  
– 각 행마다 해당 객체가 점유하는 x 구간만 표기  

{  
  "person": [  
    /* y=4~17 each */  
    {"y":4, "x":[6,15]}, {"y":5, "x":[6,15]}, {"y":6, "x":[6,15]}, {"y":7, "x":[6,15]},  
    {"y":8, "x":[6,15]}, {"y":9, "x":[6,15]}, {"y":10,"x":[6,15]}, {"y":11,"x":[6,15]},  
    {"y":12,"x":[6,15]}, {"y":13,"x":[6,15]}, {"y":14,"x":[6,15]}, {"y":15,"x":[6,15]},  
    {"y":16,"x":[6,15]}, {"y":17,"x":[6,15]}  
  ],  
  "bookshelf": [  
    /* y=4~17 full */  
    {"y":4, "x":[0,29]}, …, {"y":17,"x":[0,29]}  
  ],  
  "banner": [  
    {"y":0,"x":[0,10]}, {"y":1,"x":[0,10]}, {"y":2,"x":[0,10]}, {"y":3,"x":[0,10]}  
  ],  
  "text_overlay": [  
    {"y":16,"x":[0,29]}, {"y":17,"x":[0,29]}  
  ]  
}

**마지막으로 아래 형식의 JSON만 반환해:**  
```json
{
    "task":[
        {"input": [...], "output": [...], "solution": "…"},
        {"input": [...], "output": [...], "solution": "…"}
    ]
}
```

자 이제 마지막으로 각 문제별로 실수없이 너가 문제를 잘 만들어서 푸는사람이 혼선이 없게 '정답'이 있게끔 만들었는지
다시한번 검증해봐. 만약 실수한 부분이 있다면 즉시 정확하게 고쳐서 다시 줘야할꺼야.

**돌려줄 때는 역시 마찬가지로  아래 형식의 JSON로 반환해줘, 2차원 배열의 각 요소는 0~9 중 하나를 값으로 가져: **  
```json
{
    "task":[
        {"input": [...], "output": [...], "solution": "…"},
        {"input": [...], "output": [...], "solution": "…"}
    ]
}
```

좋아 이제 input을 바탕으로 Output을 만드는 소스코드를 짜서 code안에 넣어어 줘

```json
{
    "task":[
        {"input": [...], "output": [...], "code": "…"},
        {"input": [...], "output": [...], "code": "…"}
    ]
}
```
